import React from 'react'
import Sub from './Sub'

export default function Super (props){
    
    function quandoClicar(valor, texto) {
        console.log("Ação!!!")
        console.log(valor)
        console.log(texto)
    }
    
    return (
        <div>
            <h4>Valor</h4>
            <Sub onClicar={quandoClicar}></Sub>
        </div>
    ) ;
};
